import React, { Component } from 'react';

class BoxList extends Component {
  constructor(props) {
    super(props);

    this.state = {
      str: '',
      open: false,
    }
  }

  render() {
    return (
      <div>
        {this.props.children}
      </div>
    )
  }
}

export default BoxList;
